import React from 'react';

const Home = () => {
    return (
        <div>
            <div class="row justify-content-center my-3 px-3">
                <button class="btn-block btn-color">register</button>
            </div>
            <div class="row justify-content-center my-3 px-3">
                <button class="btn-block btn-color">List of employee</button>
            </div>
        </div>

    )
}

export default Home
